import styled from "styled-components";

const TotoHeadBlock = styled.div`
  padding-top: 48px;
  padding-bottom: 24px;
  padding-left: 32px;
  padding-right: 32px;
  border-bottom: 1px solid #e9ecef;

  h1 {
    margin: 0;
    font-size: 36px;
    color: #343a40;
  }

  .day {
    margin-top: 4px;
    color: #868e96;
    font-size: 21px;
  }

  .task-left {
    color: #20c997;
    font-size: 18px;
    margin-top: 40px;
    font-weight: bold;
  }
`;

let today = new Date();
let year = today.getFullYear();
let month = today.getMonth();
let date = today.getDate();
let day = today.getDay();
let todayResult = `${year}년 ${month}월 ${date}일`;

function TodoHead() {
    return (
        <TotoHeadBlock>
            <h1>{todayResult}</h1>
            <div className='day'>{day}</div>
            <div className='tasks-left'>할 일 2개 남음</div>
        </TotoHeadBlock>
    )
}

export default TodoHead;
